import PizzaCard from "./PizzaCard";

const PizzaMainDisplay = ({ orders, updateOrderStage, cancelOrder }) => {
  return (
    <>
      <h4 className="text-center ">Order List</h4>
      <div className="scrollable-container" style={{ maxHeight: "500px", overflowX: "auto" }}>
        <div className="row row-cols-1 row-cols-md-2 g-2">
          {orders.map((order) => (
            <PizzaCard
              key={order?.id}
              order={order}
              updateOrderStage={updateOrderStage}
              cancelOrder={cancelOrder}
            />
          ))}
        </div>
      </div>
    </>

  );
};

export default PizzaMainDisplay;
